def ROcalc(H, n, E):
    sigma   = np.linspace(0, 800, 1000)
    epsilon = (sigma/E)+((sigma/H) ** (1/n))

    #epsilon = np.linspace(0, 0.11, 1000)
    #epsilon_0 = ((H / E) ** (-1 / (n - 1)))
    #sigma = np.zeros([len(epsilon)])

    #ii = 0
    #while ii < len(epsilon):
    #    if epsilon[ii] < epsilon_0:
    #        sigma[ii] = (E*epsilon[ii] / 1000)
    #    else:
    #        sigma[ii] = (H*(epsilon[ii]**n) / 1000)
    #    ii += 1

    return epsilon, sigma/1000

def plas_ROcalc(H, n, E):
    epsilon = np.linspace(0.0001, 0.11, 1000)
    sigma = np.zeros([len(epsilon)])

    ii = 0
    while ii < len(epsilon):
        sigma[ii] = (H*(epsilon[ii]**n) / 1000)
        ii += 1

    return epsilon, sigma

