from sklearn.ensemble import GradientBoostingRegressor
model1 = GradientBoostingRegressor(
                max_depth = 9,
                n_estimators = 401,
                learning_rate = 0.1,
                loss = 'ls',
                random_state = 1,
                criterion = 'friedman_mse')
model1.fit(X, np.ravel(y, order='C'))
y_pred = model1.predict(X_known)

